function jsp_checkPasswordAndConfirmPasswordByElementIds(e,t,n,d){var l=document.getElementById(e).value,o=document.getElementById(t).value;document.getElementById(n).value,document.getElementById(d).value;return 0==o.length?(document.getElementById(n).style.display="block",void(document.getElementById(d).style.display="none")):l.length>0&&o.length>0&&l==o?(document.getElementById(n).style.display="none",void(document.getElementById(d).style.display="none")):l.length>0&&o.length>0&&l!=o?(document.getElementById(n).style.display="none",void(document.getElementById(d).style.display="block")):void 0}